import React from "react";
import OtherHalfWindowRightImage from './res/otherhalfwindowright.jpg';
import './Tile.css'

const OtherHalfWindowRight = () => {
    return (
        <img className="myTileImg" src={OtherHalfWindowRightImage}/>
    )
};

export default OtherHalfWindowRight;
